u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"115914","type":"Paragraph"},{"attributes":{},"id":"115765","type":"LinearScale"},{"attributes":{"axis":{"id":"115767"},"ticker":null},"id":"115770","type":"Grid"},{"attributes":{"data_source":{"id":"115631"},"glyph":{"id":"115632"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"115633"},"selection_glyph":null,"view":{"id":"115635"}},"id":"115634","type":"GlyphRenderer"},{"attributes":{"axis":{"id":"115771"},"dimension":1,"ticker":null},"id":"115774","type":"Grid"},{"attributes":{"axis":{"id":"115613"},"dimension":1,"ticker":null},"id":"115616","type":"Grid"},{"attributes":{"axis_label":"Casos Acumulados","formatter":{"id":"115640"},"ticker":{"id":"115614"}},"id":"115613","type":"LinearAxis"},{"attributes":{"data":{"x":{"__ndarray__":"AACAaDkSd0IAAEDOixJ3QgAAADTeEndCAADAmTATd0IAAID/ghN3QgAAQGXVE3dCAAAAyycUd0IAAMAwehR3QgAAgJbMFHdCAABA/B4Vd0IAAABicRV3QgAAwMfDFXdCAACALRYWd0IAAECTaBZ3QgAAAPm6FndCAADAXg0Xd0IAAIDEXxd3QgAAQCqyF3dCAAAAkAQYd0IAAMD1Vhh3QgAAgFupGHdCAABAwfsYd0IAAAAnThl3QgAAwIygGXdCAACA8vIZd0IAAEBYRRp3QgAAAL6XGndCAADAI+oad0IAAICJPBt3QgAAQO+OG3dCAAAAVeEbd0IAAMC6Mxx3QgAAgCCGHHdCAABAhtgcd0IAAADsKh13QgAAwFF9HXdCAACAt88dd0IAAEAdIh53QgAAAIN0HndCAADA6MYed0IAAIBOGR93QgAAQLRrH3dCAAAAGr4fd0IAAMB/ECB3Qg
